import React, { lazy } from 'react';
import Loadable from '../layouts/Loadable';

const PokemonLayout = Loadable(lazy(() => import('../layouts/PokemonLayout')));
const HomePage = Loadable(lazy(() => import('../pages/Home/Home')));

const Router = [
  {
    path: "/",
    element: <PokemonLayout />,  // Layout que incluye el PokemonDetails
    children: [
      { path: "", element: <HomePage /> },
      // otras rutas que también utilizan PokemonDetails
    ],
  },
  // otras rutas que no necesitan PokemonDetails pueden ir aquí
];

export default Router;
